function find_highest_frequency_number(arr) {
    var frequency_counter = {};
    var highest_frequency_number = -1;
    for (var i = 0; i < arr.length; i++) {
        if (frequency_counter[arr[i]] == undefined) {
            frequency_counter[arr[i]] = 1;
        }
        else {
            frequency_counter[arr[i]] += 1;
        }
    }
    for (var num in frequency_counter) {
        if (parseInt(num) == frequency_counter[num] && highest_frequency_number < parseInt(num)) {
            highest_frequency_number = parseInt(num);
        }
    }
    return highest_frequency_number;
}
